import { moduleMetadata } from '@storybook/angular';
import { BreadcrumbsComponent } from '../../_navigation/breadcrumbs/breadcrumbs.component';
import { BreadcrumbModule } from 'primeng/breadcrumb';
const meta = {
    title: 'Navigation/Breadcrumbs',
    component: BreadcrumbsComponent,
    tags: ['autodocs'],
    decorators: [moduleMetadata({ imports: [BreadcrumbModule] })],
    argTypes: {
        wrapperClassNames: { description: 'Custom CSS classes as component wraps' },
        classNames: { description: 'Custom CSS classes' },
        breadcrumbs: { description: 'Items data structure' },
        action: { description: 'Item click event' }
    },
    parameters: {
        docs: {
            description: {
                component: `Wrapper component for [PrimeNg Breadcrumbs](https://primeng.org/breadcrumb) used to show a breadcrumbs navigation list<br>
 							A **[breadcrumbs]** array data list is needed for show datas using the same structure of [PrimeNg MenuModelItem](https://primeng.org/menumodel).`,
            }
        },
    },
};
export default meta;
const sampleBreadCrumbs = [
    { label: 'Events', routerLink: ['pippo'] },
    { label: 'Back-office', },
    { label: 'Workforce', },
    { label: 'Demand planning', }
];
export const _BreadcrumbsComponent = {
    args: {
        wrapperClassNames: '',
        classNames: '',
        breadcrumbs: sampleBreadCrumbs,
    },
};
